he National Information Technology (NIT) Academy and global technology company SAP have joined hands to develop Saudi talent for the workforce of the future, supporting Saudi Vision 2030 and the Kingdom’s Information and Communications Technology (ICT) sector.

In this partnership, the NIT, a not-for-profit training institute, has joined SAP’s flagship digital skill build initiative, the Young Professional Program, as part of its aim to provide Saudi nationals with advanced and accelerated training programs to develop a “job-ready” talent pool.; 

Last year, the Council of Ministers endorsed a five-year strategy for the communications and information technology sector. Saudi Arabia’s ‘ICT Strategy 2019-2023’ features 13 priorities aligned with the goals of Saudi Arabia’s Vision 2030 and linked to eight distinct programs. Key aims include a 50 percent increase in workforce localisation by the year 2023. It will also attract foreign investment and contribute to empowering women in the industry.
